INSERT INTO `a_building_garden` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `content`, `file_url`, `image`, `remark`, `sort_order`, `status`, `title`, `user_name`) VALUES
	('1624273677732417536', 'admin', '2023-02-11 13:06:37.064000', 0, NULL, NULL, '翰墨歌盛世，丹青颂祖国。在全国上下深入学习贯彻党的二十大精神之际，我校举办“中国这十年”主题红色艺术展，师生们用作品传递向上向善的价值观，在潜移默化中不断增强爱校爱国爱党之情。\n此次展览由我校传媒与设计艺术学院承办，面向全体师生征集作品。活动共收到199件优秀文化作品，经过专业教师评选，共展出176件作品，其中40件作品获奖，启动仪式现场为获奖者颁发证书。\n红色文化作品展直观呈现了我国十年来取得的原创性思想、变革性实践、突破性进展和标志性成果，让师生更加深刻领会新时代十年伟大变革的内涵和重要意义。同时，师生们创作文化作品的过程亦是追寻红色记忆、赓续红色血脉、汲取奋进动力的过程。\n《中国红》作品获奖者杨佳怡同学表示，国旗在中国人的心中重于泰山，中国红的背后诉说着红色革命故事，体现出中华民族的意志与信仰，“如果信仰有颜色，那一定是中国红”。\n据悉，在全国上下掀起学习贯彻党的二十大精神热潮以来，我校陆续开展了思政风采大赛、非遗进校园等红色主题教育活动，坚持思政性与艺术性、教育性与趣味性相结合，从优秀文化作品中不断汲取精神力量，并转化为争创中国特色社会主义标杆民办大学的奋进动力。\n本次红色艺术展由党群工作部、学生工作部主办，校长助理胡江，党群工作部、学生工作部、国际学院、传媒与设计艺术学院负责人等出席启动仪式。\n', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377562148638720.jpg', 'http://dq.wzbc.edu.cn/Art/Art_1968/Art_1968_115768.aspx', 1.00, '已发布', '我校举行“中国这十年”红色艺术展', '管理员'),
	('1624273926785994752', 'admin', '2023-02-11 13:07:36.463000', 0, NULL, NULL, '为深入学习贯彻党的二十大精神，激发全校师生爱党爱国热情，进一步增强凝聚力和向心力，展示师生蓬勃向上的精神风貌，12月7日晚，我校举办“踔厉奋发新时代，砥志砺行向未来”师生红歌赛。\n执行校长、党委书记周湘浙，校学术委员会主任谢健、副校长赵心泽、校长助理吕文威出席红歌赛。温州大学学前教育研究所副所长李晓燕、温州大学音乐学院继续教育中心副主任许天鸣，副校长、党委副书记李益明，副校长唐若、校长助理胡江担任评委。\n李益明在致辞中表示，经典红色歌曲，不但承载着红色记忆，凝结着红色精神，更集中表达了共产党人坚持真理、坚守理想的崇高追求。希望全体师生唱响红色歌、鼓足精气神，营造出健康向上、团结奋斗的氛围，以实际行动推动本科教学工作合格评估的顺利展开，在新征程中展现温州商学院新作为，坚持“为党育人，为国育才”，办好人民满意的教育，以实际行动落实党的二十大精神。\n校大学生艺术团歌舞节目《灯火里的中国》拉开红歌赛的序幕。\n率先登场的国际学院带来《军中绿花》和《绒花》，师生用嘹亮的歌声承载着真挚的祝愿，抒发对伟大祖国的无限热爱。\n信息工程学院合唱团气势磅礴地演绎了《黄河船夫曲》与《保卫黄河》，展现了炎黄子孙顽强不屈的昂扬斗志，歌声催人奋进。', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377588736331776.jpg', 'http://dq.wzbc.edu.cn/Art/Art_1968/Art_1968_115769.aspx', 2.00, '已发布', '踔厉奋发新时代，砥志砺行向未来｜我校举办师生红歌赛', '管理员'),
	('1624274562382434304', 'admin', '2023-02-11 13:10:07.985000', 0, NULL, NULL, '11月12日上午，我校在博爱厅举行2022年秋季学期党校培训班开班仪式暨党校第一课。校党委副书记兼纪委书记、副校长李益明出席并讲话，各二级学院党支部书记、党建指导老师、发展对象培训班全体学员，以及各院入党积极分子代表参加开班仪式。\n\n会上，李益明要求全体学员要端正学习态度，严格遵守培训纪律，正确处理好学习与工作生活的关系，力求学有所获，做到学以致用。他希望全体学员通过学习，进一步坚定理想信念，提升政治思想觉悟，增强对党的宗旨、理想信念的认同感，学深悟透习近平新时代中国特色社会主义思想和党的二十大精神，提高理论指导行动的能力。\n\n仪式上，党建指导老师宣读《党校学员原则》，学生代表上台表态发言。温州大学马克思主义学院讲师吴琼博士受邀带来了党校第一课，以《把握“中国式现代化”核心要义——学习中共二十大报告》为题，深入浅出地阐述什么是中国式现代化，希望新时代青年要明确使命与担当，找准自我定位，在民族伟大复兴进程中贡献人生价值。\n\n校学生事务部负责人主持开班仪式。', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', 'http://dq.wzbc.edu.cn/Art/Art_1968/Art_1968_115124.aspx', 3.00, '已发布', '我校秋季学期党校培训班开班', '管理员');
INSERT INTO `a_college_department` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `content1`, `content2`, `content3`, `content4`, `image1`, `image2`, `image3`, `title`) VALUES
	('1624247562678702080', 'admin', '2023-02-11 11:22:50.692000', 0, NULL, NULL, ' 学院始于2005年的温州大学城市学院经贸系，2018年更名为金融贸易学院。在学校建设“最优服务学生大学”目标引领下，学院全面落实“立德树人”根本任务及“三全育人”机制建设，立足温州地方经济发展实际，秉承“义利并举、知行合一”院训，推行“产学研协同、四合作联动”的应用型教学模式改革。近五年，学生就业率均在96%以上，超过15%的毕业生赴伦敦大学学院（UCL）、爱丁堡大学等国内外知名大学继续深造。', '金融贸易学院党委书记：陈工\n金融贸易学院院长、党委副书记：汪占熬\n金融贸易学院副院长：张士军\n金融贸易学院党委副书记、副院长：陈小玲\n金融贸易学院副院长：郑成思', '兼容贸易学院的机构设置', '李扬教授，温州商学院校长，中国社会科学院学部委员、国家金融与发展实验室理事长。主要研究货币、银行、金融市场、财税。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377562148638720.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377626170494976.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377644042424320.jpg', '兼容贸易学院'),
	('1624248291770372096', 'admin', '2023-02-11 11:25:44.521000', 0, NULL, NULL, '管理学院扎根温州创业沃土，以商为魂，坚持以“最优服务学生”为办学宗旨，以打造创业特色鲜明的高水平应用型管理学院为目标；秉承“时代性、地方性、创业教育特色”的人才培养理念，确立培养具有“国际化视野、创业者思维、管理者素养、数智化技能”的应用型管理人才；致力培育具有良好的家国情怀和人文素养，拥有温商特质的新生代企业家。', '阳杰 院长\n杨文兵 党委书记\n袁红富 党委副书记\n吴肖蓉 副院长\n戴晓震 副院长', '管理学院的机构设置', '谢健教授，男，1964年出生于温州, 校学术委员会主任，温州市“两个健康”研究院院长，温州乡学院院长。 1985年毕业于浙江大学半导体器件专业，获学士学位；1987年毕业于浙江大学管理工程系工业管理工程专业，获硕士学位。现为温州商学院常务副校长、管理学教授。历任温州大学企业管理教研室主任、经济管理系副主任、经济与行政管理系副主任、管理学院副院长、常务副院长、城市学院常务副院长', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377644042424320.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377562148638720.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', '管理学院'),
	('1624249009256402944', 'admin', '2023-02-11 11:28:35.586000', 0, NULL, NULL, '国际学院是学校下设的专门开展特色外语教育、国际合作教育的二级学院，是学校国际化办学的特色窗口。学院以最优服务学生为办学理念，通过以生为本、质量立院为实现路径，培养立足温州，面向浙江，适应地方经济社会全面发展的高素质应用人才。 ', '唐若 副校长、国际学院党委书记\n吕文威 校长助理、国际学院院长\n谢世民 常务副院长/党委副书记\n姜闽虹 副院长\n张琼心 院长助理\n李小桃 院长助理', '行政科室、教学组织、基层党支部', '吕文威 教授，民盟成员，英国牛津大学教育学博士，北京市顺义区政协委员，国家留学基金委特聘专家，现任温州商学院校长助理、国际学院院长。\n现兼任中国国际贸易学会理事、北京市欧美同学会理事、北京市海淀区家庭教育协会副会长、民盟北京市顺义区第三届委员会委员、北京工业大学耿丹学院董事会董事。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377588736331776.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377644042424320.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377562148638720.jpg', '国际学院'),
	('1624249805993807872', 'admin', '2023-02-11 11:31:45.542000', 0, NULL, NULL, '传媒与设计艺术学院由原艺术设计学院和传媒学院于2018年合并组建而成。近年来，学院围绕学校地方性、教学为主、应用型本科高校办学类型定位，实行“艺商融合·三创一体”的应用型教学模式改革，立足温州、面向浙江、辐射全国，服务地方经济和文化创意产业发展。', '吴耀 传媒与设计艺术学院院长\n黄玉叶 传媒与设计艺术学院党委副书记、副院长\n张生 传媒与设计艺术学院副院长\n景占伏 传媒与设计艺术学院党委副书记、副院长', '传媒与设计艺术学院的机构', '温州瓯越文创产品设计教师创新团队\n人文艺术类唯一入选团队', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377562148638720.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377626170494976.jpg', '传媒与设计艺术学院'),
	('1624250469096493056', 'admin', '2023-02-11 11:34:23.635000', 0, NULL, NULL, '信息工程学院是温州商学院唯一一个理工科学院，肇始于1999年温州大学信息科学与工程学院，在学校建设“最优服务学生大学”目标引领下，学院全面落实“立德树人”根本任务及“三全育人”机制建设。学院专业人才培养定位立足温州，面向浙江，辐射全国，服务IT行业和地方数字经济建设。学院根据学校地方性、应用型、教学型的办学定位，明确学院专业定位为应用型“IT+商科”，以工程教育专业认证标准开展面向产出的人才培养，突出思政引领、面向产出、产教融合的培养思路。', '院长、副书记 高巍巍\n副书记、副院长 姜良\n副院长 陈久强\n副院长 吴暾华', '一个中心，两个办公室，4个系', '高巍巍教授\n吴暾华教授\n白宝钢教授\n匡芳君教授\n刘芷余教授\n张思扬教授\n陈久强副教授', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377562148638720.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377626170494976.jpg', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', '信息工程学院');
INSERT INTO `a_competition_registration` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `content`, `file_url`, `image`, `remark`, `sort_order`, `status`, `title`, `user_name`) VALUES
	('1624274766384992256', 'admin', '2023-02-11 13:10:56.651000', 0, NULL, NULL, '为推广我校数据分析实践教学，培养学生数据分析的应用和创新能力，增加校企交流合作和信息共享，提升我校的教学质量和企业的竞争能力，由泰迪杯数据分析技能赛组织委员会主办，广东泰迪智能科技股份有限公司承办，广东省工业与应用数学学会、人民邮电出版社及北京泰迪云智信息技术研究院协办的“泰迪杯”数据分析技能赛（以下简称技能赛）于2021年9月举行。竞赛目的在于以赛促学，激励学生学习数据分析的积极性，提高学生分析、解决实际问题的职业技能；以赛促教，推动数据分析技术在院校的推广和应用；以赛促创，通过竞赛提高学生的数据分析应用创新能力。\n\n \n\n【竞赛详情】\n\n1、2021年竞赛时间如下：\n\n报名起始时间：2021年9月6日-11月10日\n\n赛前指导时间：2021年9月13日-11月10日\n\nA题竞赛时间：2021年11月13日 8:00-20:00\n\nB题竞赛时间：2021年11月14日 8:00-20:00\n\n视频答辩时间：2021年12月上旬，具体时间另行通知\n\n成绩公示时间：2021年12月中下旬\n\n最终成绩公布时间：2021年12月中下旬\n\n颁奖时间：待定\n\n \n\n2、由组委会聘请专家组成评阅委员会，评选出一等奖、二等奖、三等奖。获奖比例之和一般不超过参赛总数的40%，其余成功提交有效作品的参赛队均获得成功参赛证书。\n\n一等奖：不超过8%，颁发“泰迪杯”数据分析技能赛一等奖荣誉证书。\n\n二等奖：不超过12%，颁发“泰迪杯”数据分析技能赛二等奖荣誉证书。\n\n三等奖：不超过20%，颁发“泰迪杯”数据分析技能赛三等奖荣誉证书。\n\n在一等奖中，采用视频答辩的形式，每题每组评选出一个队获泰迪杯，颁发奖杯及现金奖励。如两题的泰迪杯由同一个队获得，只颁发一个泰迪杯。\n\n', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377644042424320.jpg', 'http://xg.wzbc.edu.cn/Art/Art_880/Art_880_106379.aspx', 1.00, '已发布', '关于开展第四届“泰迪杯”数据分析技能赛的通知', '管理员'),
	('1624274871620079616', 'admin', '2023-02-11 13:11:21.710000', 0, NULL, NULL, '为贯彻落实《中国教育现代化2035》和《国务院关于印发新时期促进集成电路产业和软件产业高质量发展若干政策的通知》有关精神，为我国制造强国和网络强国战略提供人才支持，加快高等院校计算机、软件及电子信息专业教学创新与改革，提高学生自主创新意识和工程实践能力，中心决定举办第十三届蓝桥杯全国软件和信息技术专业人才大赛。本次大赛由工业和信息化部人才交流中心作为主办单位。大赛入围中国高等教育学会“全国普通高校大学生竞赛排行榜”竞赛项目榜单。现将大赛有关事项通知如下：\n\n \n\n一、大赛事项\n\n（1）C/C++程序设计（研究生组、大学 A 组、B 组、C 组）\n\n（2）Java 软件开发（研究生组、大学 A 组、 B 组、C组）\n\n（3）Python 程序设计（研究生组、大学 A 组、 B 组、C组）\n\n各赛项的具体规则及章程请查看大赛官网。\n\n \n\n二、时间安排\n\n报名：2021年10月12日——2021年12月17日\n\n校内赛：2021年12月\n\n省赛：2022年3月底或4月\n\n总决赛：2022年5月底或6月\n\n若受疫情影响，大赛时间调整，大赛组委会将另行通知。\n\n \n\n三、报名相关\n\n1.报名材料有报名表、身份证复印件、学生证复印件、2寸证件照相片，以上均需要电子扫描版，通过报名系统上传。大赛官网：www.lanqiao.cn。\n\n2.如选手进入决赛，在决赛报名时，科目和组别需与省赛保持一致，不可更换科目和组别。\n\n \n\n四、奖项设置\n\n1.省赛\n\n省赛每个组别设置一、二、三等奖，原则上各奖项的比例为10%、20%、30%。获奖比例仅作为参考，组委会专家组将根据赛题难易程度及整体答题情况，制定获奖最低分数线，未达到获奖最低分数线者不得奖。\n\n省赛一等奖选手获得直接进入全国总决赛资格。\n\n \n\n2.总决赛\n\n全国总决赛按参赛项目和成绩，为获奖学生、教师和组织单位颁发相应证书和奖励。其中：\n\n个人赛根据相应组别分别设立一、二、三等奖及优秀奖。其中，一等奖不高于5%，二等奖占20%，三等奖不低于35%，优秀奖不超过 40%，零分卷不得奖。\n\n \n\n3.获奖证书\n\n所有获奖选手均可获得由工业和信息化部人才交流中心及大赛组委会联合颁发的获奖证书。\n\n请对参赛有兴趣的同学扫码进群', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377626170494976.jpg', 'http://xg.wzbc.edu.cn/Art/Art_880/Art_880_106373.aspx', 2.00, '已发布', '关于第十三届蓝桥杯全国软件和信息技术专业人才大赛报名通知', '管理员'),
	('1624274993183592448', 'admin', '2023-02-11 13:11:50.713000', 0, NULL, NULL, '为贯彻落实习近平主席在十九大报告中关于“推动互联网、大数据、人工智能和实体经济深度融合”以及“善于运用互联网技术和信息化手段开展工作”等讲话精神，进一步增强大学生就业竞争力，提升在校大学生的IT应用和实践综合能力，培养企业适用人才，推动各高等院校计算机教育教学改革与创新，由全国高等院校计算机基础教育研究会主办的2021第四届“传智杯”全国大学生程序设计竞赛将于2021年11月20日举行练习赛，2021年12月19日举行区域赛。\n\n \n\n竞赛详情\n\n程序设计赛道采用 ACM-ICPC 赛制。\n\n为了鼓励更多人参与，本次大赛设置了不同难度的赛场，参赛选手可根据自己当前的实力任选一场参赛。\n\n不管你是“黄金”段位还是“王者”大神，只要你对算法感兴趣，并且至少掌握一种程序设计语言，就能够参加本次大赛。\n\n重点考察选手的算法和程序设计能力，不考察实际工程中常用的系统编程，多线程编程等等；程序设计赛道要求参赛者使用程序设计语言（包括：Java、C/C++、Python）解决挑战性算法问题。程序完成之后提交运行，系统自动判定程序为正确或错误并将运行的结果反馈给参赛者，根据解题数和答题耗时进行排名。\n\n \n\n参赛规则\n\n1.每场比赛均为3小时。在这3小时内，参赛者需使用规定的程序设计语言（仅包括C、C++（C++11/C++14）、Python（Python2/Python3）和Java），按照规定时间内在线上竞赛平台在线CODING，解决若干道挑战性算法问题。参赛者完成每道题后，对代码提交运行，系统将自动判定程序为正确或错误并将运行的结果反馈给参赛者。初赛的每场比赛结束后，系统将根据参赛者的答题准确率和答题耗时，对参赛者进行排名。\n\n2. 最终排名等于解出题目数量更多的选手排名靠前。解题数量相同时，罚时少的选手排名靠前。因此请尽早提交，并尽可能减少提交次数。\n\n3. 大赛主办方有权结合参赛者报名情况、竞赛情况等实际因素，调整晋级复赛的人数。\n\n \n\n比赛平台\n\n若无重大意外，本次比赛将在洛谷评测平台(luogu.com.cn/)上进行。', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', 'http://xg.wzbc.edu.cn/Art/Art_880/Art_880_106147.aspx', 3.00, '已发布', '关于开展第四届“传智杯”全国大学生计算机大赛的通知', '管理员'),
	('1661692465289236480', 'admin', '2023-05-25 19:15:31.261000', 0, NULL, NULL, '时间\n地点', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377588736331776.jpg', '', 4.00, '已发布', '运动会', '管理员');
