INSERT INTO `a_education_teaching` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `content`, `file_url`, `image`, `remark`, `sort_order`, `status`, `title`, `user_name`) VALUES
	('1624275364916367360', 'admin', '2023-02-11 13:13:19.000000', 0, 'admin', '2023-02-11 13:13:27.294000', '各班班主任：\n\n为进一步加强德育工作，深入推进班主任队伍专业化建设，提高班主任管理工作水平，信息工程学院举办了第二届班主任“班容班融”素质能力大赛，经过笔试、网络投票、主题班会设计等三个环节的评比，在此基础上评出第二届班主任“班容班融”素质能力大赛一等奖2名，二等奖5名，三等奖6名，现将大赛结果予以公示。公示期为2022年12月12日-12月14日，公示期内如有异议，请注明真实姓名以及联系方式，将内容发至邮箱：xgxy66666@163.com。', 'http://xg.wzbc.edu.cn/UploadFile/202211/202211031459049495.rar', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377644042424320.jpg', 'http://xg.wzbc.edu.cn/Art/Art_867/Art_867_115645.aspx', 0.00, '已发布', '关于公布信息工程学院第二届班主任“班容班融”素质能力大赛结果的通知', ''),
	('1624275581245984768', 'admin', '2023-02-11 13:14:10.000000', 0, 'admin', '2023-02-11 13:14:47.058000', '各学院、各班级：\n\n为深入贯彻落实学校安全工作会议精神，切实加强学生寝室安全管理工作，提高学生安全意识和能力，现组织开展主题班会工作，具体通知如下。\n\n一、班会主题\n\n消除安全隐患，强化安全意识\n\n二、班会时间\n\n2022.11.29-2022.12.8\n\n三、班会地点\n\n  各班级教室/线上会议形式\n\n四、班会目的\n\n  （一）加强思想教育。通过主题班会的形式深入推进公寓管理规章制度学习，提升学生安全意识与能力。科普常用消防知识，提升学生自救自保能力，包括如何防火，如何灭火，逃生指南等。加强学生思想政治教育，让学生引以为鉴，汲取经验教训，提高思想认知，提升寝室安全意识与能力。\n\n （二）提高安全意识。引导学生宿舍安全用电意识，认清寝室安全隐患类型和严重危害，增强安全意识，提高防范能力，提升自救自保能力，筑牢寝室安全的“防火墙”。\n\n （三）养成遵纪习惯。通过剖析学生身上的违纪事例以及对学生自身的影响，教育学生牢固树立纪律意识，规矩意识，逐渐养成遵纪守规的习惯。\n\n五、活动要求\n\n （一）安全教育常态开展。各班级根据实际情况定期开展富有成效的安全教育，形成安全教育主题班会常态化，使学生形成遵纪守律的良好风貌。\n\n （二）贯彻落实三全育人，抓学生思想建设，抓班级全面建设。\n\n （三）营造氛围形成长效。充分利用公众号、微信班级群、校讯通等开展警示宣传教育，不断扩大教育影响力，营造更加安全、和谐的校园环境。\n\n  各班级于12月8日18：00之前将主题会材料-班会记录表（含照片）以班级命名上交到信息工程学院邮箱：xgxy66666@163.com。\n\n六、注意事项\n\n   1.高度重视，周密部署。各班级要高度重视开学班会，加强引导、注重落实和监督，从实际出发，采取有效的班会形式，把思想性、趣味性、知识性、教育性结合起来，要十分重视学生对困难学生的帮扶工作，注重形成学风建设的长效机制，不断提高学生的思想道德水平和综合素质。\n\n   2.认真准备，按时召开。班主任按照学院要求，提前做好班会准备，结合本专业特色和班级学生特点，在规定的时间内召开，不得提前或推后。不得由班干部或其他老师代为召开，并要认真指导、检查、总结各班主题班会的开展情况，填写班会记录表。\n\n   3.严格管理，注重实效。每位班主任要结合实际情况，策划、组织班会的开展，真正体现班会的作用和效果。班会后认真总结，鼓励学生撰写心得体会，找出成绩和不足，确保活动不走过场、不流于形式，取得实实在在的实效，为今后有的放矢地开展学生工作提供依据。', 'http://www.wzbc.edu.cn/UploadFile/202211/202211291408465910.doc', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377626170494976.jpg', 'http://xg.wzbc.edu.cn/Art/Art_867/Art_867_115389.aspx', 0.00, '已发布', '信息工程学院关于开展安全教育主题班会的通知', ''),
	('1624275662795837440', 'admin', '2023-02-11 13:14:30.278000', 0, NULL, NULL, '各系（教研室）：\n\n根据《温州商学院关于开展2022年秋季专业技术职务评聘工作的通知》精神，综合申报职称者的各方面情况，经院职称评聘推荐小组讨论，现对我院2022学年秋季学期申报职称者申报材料予以公示。\n\n1、公示时间：2022年10月14日—10月16日。\n\n2、反映问题的方式和要求：对申报对象的资格如有异议，在公示期限内，任何个人均可通过来信、来电、来访的形式，向学院办公室反映。以个人名义反映问题的要求署名本人真实姓名。反映问题要实事求是，客观公正，反对借机诽谤诬告。\n\n3、公示联系办公室：北校区3-507，联系电话：0577-86597024 。', 'http://xg.wzbc.edu.cn/UploadFile/202211/202211031459049495.rar', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', 'http://xg.wzbc.edu.cn/Art/Art_867/Art_867_114898.aspx', 0.00, '已发布', '信息工程学院2022年春季专业技术职务申报人员情况的公示', '');
INSERT INTO `a_enrollment_employment` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `content`, `file_url`, `image`, `remark`, `sort_order`, `status`, `title`, `user_name`) VALUES
	('1624276104367968256', 'admin', '2023-02-11 13:16:15.634000', 0, NULL, NULL, '2022年浙江省普通一段线为497分；\n2022年浙江省普通二段线为280分；\n\n1.综合成绩=学业水平测试成绩（折算为满分100分）×15%+综合素质测试（校考）成绩（满分为100分）×25%+高考总分（总分750，折算为总分100分）×60%；\n\n2.综合素质测试（校考）成绩=笔试（满分为100分）×40%+面试（满分为100分）×60%；\n\n3.学业水平测试：A等计15分，B等计11分，C等计9分，D等计7分。学业水平测试成绩总分超过100分的按照100分计。', 'http://xg.wzbc.edu.cn/UploadFile/202211/202211031459049495.rar', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', 'http://zsw.wzbc.edu.cn/Art/Art_391/Art_391_114446.aspx', 1.00, '已发布', '温州商学院2022年录取信息一览表', '管理员'),
	('1624276275621400576', 'admin', '2023-02-11 13:16:56.458000', 0, NULL, NULL, '各位考生：\n\n我校2022年江西省、重庆普通类本科录取顺利完成，录取情况如下：\n注：录取后，培养类型根据学生个人志向可选择“4+1“本硕连读国际菁英班或普通班。详情见录取通知书礼包中的入学须知或来电咨询0577-86691111。\n\n即日起，考生可登陆我校招生网录取查询栏目查看录取结果。\n\n', 'http://xg.wzbc.edu.cn/UploadFile/202211/202211031459049495.rar', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377626170494976.jpg', 'http://zsw.wzbc.edu.cn/Art/Art_407/Art_407_112263.aspx', 2.00, '已发布', '我校2022年江西、重庆本科录取结束，开通录取查询', '管理员');
