INSERT INTO `a_realtime_information` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `content`, `file_url`, `image`, `remark`, `sort_order`, `status`, `title`, `user_name`) VALUES
	('1624276539162103808', 'admin', '2023-02-11 13:17:59.294000', 0, NULL, NULL, '为传承中华优秀传统文化，深化学校艺术教育，丰富校园文化生活，深入推动“五化工程”建设，我校于7月11日邀请温籍书画名家开展文化交流暨现场书画创作活动。\n\n当天下午，中国书协会员、温州市书协名誉主席何元龙，中国书协会员、温州市书协主席吴聘真，中国书协会员、温州市书协顾问吴永龙，以及省美协会员、温州市鹿城区美协副主席戴慧冒着酷暑莅临我校，与师生书画爱好者互动，并挥毫泼墨, 创作了一幅幅精品力作。\n\n这些作品聚焦温州商学院独特的校园文化，突出办学理念、办学特色以及办学目标思路，如“在这里人人能出彩”“成长会做人、成才会做事”“打造最优服务学生大学”“经世致用 义利并举”“争创中国特色社会主义标杆民办大学”等，并题写了新命名的一批楼宇名称。\n\n在交流活动中，校长助理胡江代表学校对书画名家的辛勤创作表示感谢，并介绍了我校的发展历程及办学情况。近年来，随着办学规模不断扩大、办学水平不断提升，我校不断深入推动“绿化、净化、亮化、美化、文化”等“五化工程”建设，大力营造处处是文化、时时见文化的浓厚氛围。此次邀请书画名家进校园，旨在推动校园文化建设，并通过互动交流，提升师生的艺术素养。 ', 'http://xg.wzbc.edu.cn/UploadFile/202211/202211031459049495.rar', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377588736331776.jpg', 'http://www.wzbc.edu.cn/Art/Art_132/Art_132_111820.aspx', 1.00, '已发布', '温籍知名书画家来我校开展文化交流活动', '管理员'),
	('1624276730246205440', 'admin', '2023-02-11 13:18:44.841000', 0, NULL, NULL, '7月1日，我校举行结对文成县平和乡“奔富行动”启动仪式暨2022暑期社会实践出征仪式，接下来将通过整合全校相关资源，帮助打造农旅IP、捐资助学、电商带货等，全面服务平和乡建设，助力该乡东方村早日建成“两个先行”的新农村样板。\n\n启动仪式现场，温州商学院——文成县“助力两个先行区”实践基地揭牌，并举行“助力两个先行区”社会实践先行团授旗仪式、助力“两个先行区”教授博士服务团授旗仪式和实践队授旗仪式。\n\n平和乡位于文成县东南面，主导产业为茶叶，乡域内古迹众多，又是一片红色热土。此次我校与平和乡结对共建，将通过组建教授博士服务团进村方式，为当地编制乡村规划方案、打造农旅IP、为当地茶叶等农产品设计包装形象。同时，依托学校“张汉鸣慈善公益基金”，结对该乡孤寡老人以及贫困学子，开展捐资助学和爱心志愿服务活动。\n\n此外，我校暑期社会实践队将依托电子商务、网络直播等新媒体，积极为当地农产品推荐带货，增加村民收入，以及组织创业校友、校企合作单位深入平和乡开展民宿、文旅等方面的产业合作。 \n\n据悉，我校自2015年响应市委市政府号召，与文成县结对开展新青年下乡工作以来，累计共有100多支队伍3000多名师生利用寒暑假以及周末时间，奔赴文成县各文化礼堂和村社开展暖心惠民服务，超过十万群众得到实惠。我校与文成县多次获得全市新青年下乡工作先进集体。此次，中共温州市委组织部等组织开展市派第四批第一书记，我校选派王骥同志担任平和乡东方村第一书记。', 'http://xg.wzbc.edu.cn/UploadFile/202211/202211031459049495.rar', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377607602311168.jpg', 'http://www.wzbc.edu.cn/Art/Art_132/Art_132_111163.aspx', 2.00, '已发布', '我校举行结对文成县平和乡暨2022暑期社会实践出征仪式', '管理员'),
	('1624276982382596096', 'admin', '2023-02-11 13:19:44.976000', 0, NULL, NULL, '“大罗山高，瓯江水长，莘莘学子，来自四方。”伴随着悠扬绵长的校歌，四千多名毕业生缓缓踏入会场，为青春的华丽篇章画上句号，向着下一个人生节点扬帆起航。\n\n6月12日，我校举行2022届毕业典礼暨毕业生欢送会。央视热播剧《奋进的旋律》男主原型林东莅临现场寄语并作报告，澳大利亚前总理陆克文发来视频祝福。校领导周湘浙、谢健、李益明、赵心泽、唐若、吕文威出席，校长助理胡江主持。\n\n毕业典礼现场，林东热情洋溢地做了一场《创新创业——做具有科学家精神的企业家》主题报告。他寄语全体毕业生，今天我们生逢其时，遇上了最美好的时代，大家要做一位乐观主义者，步入社会后要努力成为组织的贡献者，远离品行不端的人。无论从事公务员还是企业普通员工，都要带着创业的心去做每一件事，站在上司的视角看待每一件事，这样未来一定会成为上司的得力干将或合作伙伴。\n\n林东是知名温商，杭州绿盛集团董事长、浙江省LHD大型海洋潮流能研究中心总工程师，被誉为“世界潮汐能发电王者”。2001年，他从澳大利亚学成回国后创办了杭州绿盛集团有限公司，其后投入研发潮流能发电项目，创立世界首座海洋潮流能电站，并缔造出全新的海洋清洁能源高端装备产业。2020年，中宣部根据其真人真事拍摄了一部央视热播剧《奋进的旋律》，创下全国同时段电视节目收视率第一。他希望温商院毕业生将来投身创业，要勇于科技创新，怀抱科技强国理想，争做具有科学家精神的企业家。\n\n作为浙南闽北赣东唯一一所商科类本科院校，学校从去年邀请《温州三家人》剧中海归创业扮演者黄洋洋参加开学典礼，到今年邀请《奋进的旋律》剧组原型林东参加毕业典礼，皆缘于坚持打造创业教育特色，希望青年学子产生强烈的代入感，把“偶像效应”转化为内在学习动力，培养更多“敢闯会创”创新创业人才。', 'http://xg.wzbc.edu.cn/UploadFile/202211/202211031459049495.rar', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377626170494976.jpg', 'http://www.wzbc.edu.cn/Art/Art_132/Art_132_111125.aspx', 3.00, '已发布', '我校举行2022届毕业典礼暨毕业生欢送会', '管理员'),
	('1661692309399539712', 'admin', '2023-05-25 19:14:54.092000', 0, NULL, NULL, '111', '', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1684377644042424320.jpg', '', 4.00, '已发布', '111', '管理员');
